import PropTypes from 'prop-types';

function Button({text}){
    return <button
    style={{
        backgroundColor: 'blue',
        color: 'white',
        padding: '10px 20px',
    }}
    >{text}</button>
}

Button.propTypes = {
    text: PropTypes.string.isRequired

}
export default Button;
